import React from 'react';
import {Container, Button, Box, TextField, FormControl} from '@mui/material';

class Home extends React.Component {
  render() {
    return (
      <div>
        <Container maxWidth="sm" style={{textAlign: "center"}}>
            <h1>Snooker Data Manager</h1>
            <p>Select and input params to search for players and games</p>
            <Box display="flex" justifyContent="center">
                <FormControl>
                <TextField id="outlined-basic" label="Input" variant="outlined" />
                </FormControl>
                <Box><Button variant='contained'>Hello World</Button></Box>
            </Box>
        </Container>
      </div>
    );
  }
}

export default Home;
